export default (function(a,b,c,d,e,f,g,h){return {data:{lnmeDE5PNI:{data:{id:2136,attributes:{imdbId:"tt0105159",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjQ1NTYxOGYtNzc5MC00ZDY2LWE1ODctNmZjMzliYmNlMWMzXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"39%"},{Source:"Metacritic",Value:"40\u002F100"}],item_lang:{data:{id:2799,attributes:{title:b,plot:"The Power of One is an intriguing story of a young English boy named Peekay and his passion for changing the world. Growing up he suffered as the only English boy in an Afrikaans school. Soon orphaned, he was placed in the care of a German national named Professor von Vollensteen (a.k.a. \"Doc\"), a friend of his grandfather. Doc develops Peekay's piano talent and Peekay becomes \"assistant gardener\" in Doc's cactus garden. It is not long after WWII begins that Doc is placed in prison for failure to register with the English government as a foreigner. Peekay makes frequent visits and meets Geel Piet, an inmate, who teaches him to box. Geel Piet spreads the myth of the Rainmaker, the one who brings peace to all of the tribes. Peekay is cast in the light of this myth. After the war Peekay attends an English private school where he continues to box. He meets a young girl, Maria, with whom he falls in love. Her father, Professor Daniel Marais, is a leader of the Nationalist Party of South Africa. The two fight to teach the natives English as Peekay's popularity grows via the myth. Peekay loses focus until he sees the success of his language school among the tribes. Daniel Marais comes to stop Peekay's English classes and Maria is killed during the fight. He and Guideon Duma continue the work in hopes of building a better future for Africa.",slug:"the-power-of-one"}}},books:{data:[{id:10553,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:true,published:g,publisher:h,subtitle:a}},{id:10554,attributes:{title:b,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kN1WmwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2013-01-01",publisher:a,subtitle:a}},{id:10555,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:d,published:g,publisher:h,subtitle:a}},{id:10556,attributes:{title:b,description:"This is Bryce Courtenay's classic best-selling story of the triumph of the human spirit, specially adapted for young readers. Born in a South Africa divided by racism and hatred, little six-year-old Peekay learns that small can beat big and that the most important thing is the power of one: the force for good within each individual. Visit brycecourtenay.com",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8ECW25zJOzMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1999-08-02",publisher:"Penguin Group Australia",subtitle:"Young Reader's Edition"}},{id:10557,attributes:{title:"The Power of One \u002FBryce Courtenay",description:a,thumbnail:a,authors:[c],firstBook:d,published:"1986-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940939735}}("","The Power of One","Bryce Courtenay",null,"First with your head and then with your heart ...So says Hoppie Groenewald, boxing champion, to a seven-year-old boy who dreams of being the welterweight champion of the world. For the young Peekay, its a piece of advice he will carry with him thr...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c1B4atNBSWwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-05-20","ReadHowYouWant.com"))